import Foundation
@testable import Apodini

enum FileUtilities {
    static func pathParameter(for handler: Any) throws -> Parameter<String> {
        let mirror = Mirror(reflecting: handler)
        let parameter = mirror.children.compactMap { $0.value as? Parameter<String> }.first
        guard let fileParameter = parameter else {
            //No point in continuing if there is no parameter
            fatalError("no idParameter found")
        }
        return fileParameter
    }
    
    static func getBase64EncodedTestString() -> String {
        // swiftlint:disable line_length
        ""
    }
}
